        private static void CheckForPalindrome(string str)
        {
            int invalidCharIndex = -1;
            bool charAlreadyIgnored = false;
            for (int low = 0, high = str.Length - 1; low < (str.Length + 1) / 2; low++, high--)
            {
                if (str[low] != str[high])
                {
                    if (charAlreadyIgnored)
                    {
                        invalidCharIndex = -1;
                    }
                    else
                    {
                        if (str[low + 1] == str[high] && str[low + 2] == str[high - 1])
                        {
                            invalidCharIndex = low;
                            low++;
                        }
                        else if (str[low] == str[high - 1] && str[low + 1] == str[high - 2])
                        {
                            invalidCharIndex = high;
                            high--;
                        }
                    }
                }
            }

            Console.WriteLine(invalidCharIndex);
        }
